import React from "react";

class CarouselItem extends React.Component {
  render(props) {
    return (
      <div class="carousel-item">
        <img
          class="d-block w-100"
          src={this.props.item.imgUrl}
          alt={this.props.item.id + " slajd"}
        />
      </div>
    );
  }
}
export default CarouselItem;
